import { Link } from 'react-router-dom'
import React, {useState} from "react";
import "./DatePicker.css"

const DatePicker = () => {
    const[date, setDate] = useState();

    return (
        <label>
            Deadline: {date}
        </label>
    )
}

export default DatePicker
